function recursivelyTickCheckBoxes(n){var t=document.getElementById(n),e=t.parentNode.parentNode.parentNode,u=":checked",f,r;for(t.checked&&(u=":not(:checked)"),f='[type="checkbox"]'+u,r=e.querySelectorAll(f),i=0;i<r.length;++i)r[i].checked=t.checked}function SubmitFormWithAction(n){var t=document.getElementById("deploymentAction");t.value=n;document.getElementById("dataGroupForm").submit()}function CompareButtonClicked(){SubmitFormWithAction("Compare")}function SelectButtonClicked(){SubmitFormWithAction("Transfer")}function TransferButtonClicked(){SubmitFormWithAction("Transfer")}function Cancel(){var n=document.getElementById("dataGroupId");location.href="DeploymentConfiguration.aspx?dataGroupId="+n.value}function showComparisonDetails(n,t,i){var r=document.getElementById("destinationId").value;dialog.show("ComparisonDetailsDialog","/Admin/Content/Management/Deployment/ComparisonDetails.aspx?dataGroupId="+encodeURIComponent(n)+"&dataItemTypeId="+encodeURIComponent(t)+"&dataItemId="+encodeURIComponent(i)+"&destinationId="+encodeURIComponent(r))}